import React from 'react'

const InvoiceComponent = ({cartValue}) => {
    return (
        <div className="products">
           {
                cartValue.map((item)=>           
                    <ul className="list-group w-50">
                        <li className="list-group-item"><img src={item.image} style={{display: "block", margin: "0 auto 10px", maxHeight: "200px"}} className="round"/></li>
                        <li className="list-group-item"> Name: Manish Kumar</li>
                        <li className="list-group-item">Price: $50</li>
                        <li className="list-group-item">Quantity: 2</li>
                        <li className="list-group-item">Total Price: $100</li>
                    </ul>
                )
            }

        </div>
    )
}

export default InvoiceComponent
